import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal (simulate clicking the cart icon)
    // The cart icon is a div with class 'cart'
    await page.waitForSelector('.cart');
    await page.click('.cart');

    // Wait for the cart modal to appear
    // The cart modal is expected to have id 'cartModal'
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 3000 });

    // Take screenshot of the cart modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Wait for cart items to be loaded in the modal
    // Cart items are rendered in a container with id 'cartItems'
    await page.waitForSelector('#cartItems');

    // Check if there is at least one item to remove
    const hasCartItem = await page.$('.cart-item');
    if (!hasCartItem) {
      // No items to remove, return with info
      return {
        success: true,
        action: "No items in cart to remove",
        extractedData: { cartCount: 0 },
        screenshots,
        error: null
      };
    }

    // Extract the title of the first cart item before removal for verification
    const cartItemTitle = await page.$eval('.cart-item .cart-item-title', el => el.textContent.trim());

    // Click the "Remove" button for the first cart item
    // The remove button has class 'remove-item' inside '.cart-item'
    await page.click('.cart-item .remove-item');

    // Wait for the cart to update: either .cart-item disappears or "Your cart is empty" message appears
    await page.waitForFunction(() => {
      const cartItems = document.querySelectorAll('.cart-item');
      const emptyMsg = document.querySelector('.empty-cart');
      return cartItems.length === 0 || !!emptyMsg;
    }, { timeout: 3000 });

    // Take screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_remove.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_remove.png'));

    // Extract cart count from the cart icon (should update)
    // The cart count is expected to be in an element with id 'cartCount'
    let cartCount = 0;
    try {
      cartCount = await page.$eval('#cartCount', el => parseInt(el.textContent.trim(), 10));
    } catch (e) {
      // If not found, fallback to 0
      cartCount = 0;
    }

    // Check if the cart is now empty
    const cartEmpty = await page.$('.empty-cart');
    const cartIsEmpty = !!cartEmpty;

    return {
      success: true,
      action: "Removed first item from cart",
      extractedData: {
        removedItemTitle: cartItemTitle,
        cartIsEmpty,
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
